import java.io.BufferedReader;
import java.io.IOException;
import java.io.InputStreamReader;
import java.util.*;

public class Main {
    public static void main(String[] args) throws IOException {
        BufferedReader br = new BufferedReader(new InputStreamReader(System.in));
        String[] input;
        while ((input = br.readLine().split(" ")) != null && input.length == 2) {
            int n = Integer.parseInt(input[0]);
            int m = Integer.parseInt(input[1]);
            Set<String> dirs = new HashSet<>();
            List<String> files = new ArrayList<>();
            for (int i = 0; i < n; i++) {
                String path = br.readLine();
                String[] segments = path.split("/");
                List<String> dir = new ArrayList<>();
                for (String segment : segments) {
                    if (segment.equals("..")) {
                        dir.remove(dir.size() - 1);
                    } else if (!segment.equals("") && !segment.equals(".")) {
                        dir.add(segment);
                    }
                }
                dirs.add(dir.toString());
                files.add(path);
            }
            for (int i = 0; i < m; i++) {
                String path1 = br.readLine();
                String path2 = br.readLine();
                String[] segments1 = path1.split("/");
                List<String> dir1 = new ArrayList<>();
                for (String segment : segments1) {
                    if (segment.equals("..")) {
                        dir1.remove(dir1.size() - 1);
                    } else if (!segment.equals("") && !segment.equals(".")) {
                        dir1.add(segment);
                    }
                }
